import HeroImage from '../../assets/HeroImage.jpg';
import './HeroHome.css'

function HeroHome(){
    return(
        <div className="heroContainer">
            <div className="heroText">
                <h1>Squeeze</h1>
                <p>Find a podcast to suit your needs</p>
            </div>
            <img className="heroImage" src={HeroImage} alt="Hand holding blue and white over-ear headphones in a Yellow background"/>
        </div>
    )
};

export default HeroHome;
